 Here is a simple Python script that prints out the first 100 prime numbers:

```python
def checkPrime(n):
    if n <= 1: return False
    for i in range(2, int(n**0.5)+1):
        if n % i == 0: return False
    return True

prime_numbers = []
for num in range(2, 101):
    if checkPrime(num): prime_numbers.append(str(num))
print(", ".join(prime_numbers[:100]))
```
This script uses a function `checkPrime()` to determine whether a number is prime or not. It then iterates through the numbers from 2 to 100, checking each one with this function and appending it to a list if it's found to be prime. Finally, it prints out the first 100 elements of that list as a comma-separated string.
